Hacksaw is a data store library for javascript. You can store all the states
along the app life time. For example you can store all search results without
any effort so that if the user go back and back and back the pages will still be
there.
Store Context
The idea behind Hacksaw is contextual store which means you have one store which
you can generate sub stores using contexts and also all model instances will be
shared among contexts.

Installation
npm install hacksaw --save
Example

See more example on http://hacksaw-examples.open.buildize.com

import { store } from 'hacksaw';

@store class ProductStore {}

ProductStore.all; // []
ProductStore.context('best').all; // []
ProductStore.context('trending').all; // []

//-----
ProductStore.context('best').put({ id: 1, name: 'A book' });
ProductStore.context('trending').put({ id: 2, name: 'Trending book' });
ProductStore.all // [{ id: 1, name: 'A book' }, { id: 2, name: 'Trending book' }]
ProductStore.context('best').all; // [{ id: 1, name: 'A book' }]

//-----
ProductStore.context('another-context').populate(i => i.id === 1);
ProductStore.context('another-context').first === ProductStore.first // true;

//----
ProductStore.context('trending').clean().all // [];
ProductStore.all // [{ id: 1, name: 'A book' }, { id: 2, name: 'Trending book' }]

docs/creating-store.html.body:
Creating Store
You have two way to define a store. First option is defining stores with class
and decorator, other option is using createStore method.
@store
import { store } from 'hacksaw';

@store class MyStore {
  static fetch() {
    doSomething();
  }
}


createStore
We can define the same store with createStore method;
import { createStore } from 'hacksaw';

const MyStore = createStore({
  fetch() {
    doSomething();
  }
});

docs/binding-relations.html.body:
Binding Relations
You can define relations between stores. After binding, stores will be
triggered automatically.
Usage
@bind(RelatedStore, itemPropertyName)

// or

@bind(RelatedStore, propertyGetterFunction)

// or

Store.bind(RelatedStore, itemPropertyName)

Example
// file article-store.js

import { store, bind } from 'hacksaw';
import CommentStore from './comment-store';

@store class ArticleStore {}

class ArticleModel {
  get comments() {
    return CommentStore.all.filter(comment => comment.article_id);
  }
}


// file comment-store.js

import { store, bind } from 'hacksaw';
import ArticleStore from './article-store';

@bind(ArticleStore, 'article_id')
@store class CommentStore {}


ArticleStore.listen(() => console.log('articles triggered'));
CommentStore.listen(() => console.log('comments triggered'));

ArticleStore.put([{ id: 1, title: 'item1' }, { id: 2, title: 'item2' }]);
// articles triggered

CommentStore.put({ id: 1, body: 'hello', article_id: 1 });
// comments triggered
// articles triggered

CommentStore.put({ id: 1, body: 'another' });
// comments triggered
// articles triggered

ArticleStore.put({ id: 1, title: 'another title' });
// articles triggered
// comments triggered

docs/methods/context.html.body:
.context
Context is a sub store extends the model class. You can use different sub
stores for different needs.
Usage
Store.context(node1, node2, node3, ...);

@store class ProductStore {}

ProductStore.context('search'); // returns new class extends Product.


You can use all methods on the store
@store class ProductStore {
  static myMethod() {
    return 'my value';
  }
}

ProductStore.context('aContext').myMethod(); // 'my value'


It always returns the same class
ProductStore.context('c1', 'c2') === ProductStore.context('c1', 'c2') // true

Example
// create Product store
@store class ProductStore {
  // a method that fetchs products with given query and limit
  async static fetch(query, limit) {
    const params = { query, limit };
    const { data: items } = await axios.get('/products', { params });
    this.put(items);
  }
}

const query = { title_like: 'A Book' };

// we are creating a context with dynamic query under search context.
const context = ProductStore.context('search', query);

context.fetch(query, 15); // using the method we defined above
context.listen(renderContexts); // listen changes on the store context

function renderContexts() {
  console.log(context.all);
  // [Object(id: 141, name: 'A book'), Object(id: 13, name: 'It is a book')]
  console.log(ProductStore.all);
  // [Object(id: 141, name: 'A book'), Object(id: 13, name: 'It is a book')]
  console.log(ProductStore.context('another context').all);
  // []
}

docs/methods/set.html.body:
.set
We're using .set method to change data of the store context. This enables
us to trigger events.
Usage
Store.set(object); // returns Context

Example
@store class ProductStore {}

ProductStore.listen(() => {
  // re-render component etc.
});

ProductStore.set({ isLoading: true });
ProductStore.isLoading; // true;

ProductStore.context('ctx').set({ myValue: 15 });
ProductStore.context('ctx').myValue; // 15

docs/methods/all.html.body:
.all
Returns all object of the store context.
Usage
Store.all

Example
@store class ProductStore {}

ProductStore.context('ctx1').put({ id: 1 });
ProductStore.context('ctx2').put({ id: 2 });

ProductStore.all // [Object(id: 1), Object(id: 2)]
ProductStore.context('ctx1').all // [Object(id: 1)]
ProductStore.context('ctx2').all // [Object(id: 2)]
ProductStore.context('ctx3').all // []

docs/methods/put.html.body:
.put
Appends or updates the item both in the store context and the store.
Usage
Store.put(object)
//or
Store.put(array)

// returns appended or updated item array or object

Example
@store class ProductStore {}

ProductStore.context('context1').put({ id: 1, name: 'hello' });
ProductStore.context('context1').first // Object(id: 1, name: 'hello')

// this will append the item to the current context and update the other
// contexts.
ProductStore.context('context2').put({ id: 1, name: 'test' });
ProductStore.context('context2').first // Object(id: 1, name: 'test')

// lets see the other context's item
ProductStore.context('context1').first // Object(id: 1, name: 'test')

// lets see the global store
ProductStore.first // Object(id: 1, name: 'test')

docs/methods/populate.html.body:
.populate
It adds the items to the current store context with given filter function.
Usage
Store.populate(filterFunction)

// returns the context

Example
@store class ProductStore {}

// lets add some item to the store first.
ProductStore.put([{ id: 1, count: 4 }, { id: 2, count: 5 }, { id: 3, count: 6 }]);

// see our store context is empty.
ProductStore.context('my-context').all // []

// lets populate the context
ProductStore.context('my-context').populate(item => item.count % 2 === 0);

// lets see the last data of the store context
ProductStore.context('my-context').all // [Object(id: 1, count: 4), Object(id: 3, count: 6)]

// or we could use it with chain
ProductStore.context('another')
       .populate(i => i.id > 2)
       .all // [Object(id: 3, count: 6)]

// the items will exactly be the the same
ProductStore.context('my-context').last === ProductStore.context('another').last // true

docs/methods/listen.html.body:
.listen
Adds a callback to listen updates on contexts.
Usage
Store.listen(callback);

// returns context

Example
@store class ProductStore {}

ProductStore.listen(() => console.log('global update'));
ProductStore.context('node1').listen(() => console.log('node 1 updated'));
ProductStore.context('node1', 'node2').listen(() => console.log('node 2 updated'));
ProductStore.context('another').listen(() => console.log('another updated'));

ProductStore.put({ id: 1, name: 'Book' });
// global update

ProductStore.context('node1').put({ id: 2, name: 'node1 book' });
// global update
// node 1 update

ProductStore.context('node1', 'node2').put({ id: 3, name: 'node2 item' });
// global update
// node 1 update
// node 2 update

ProductStore.context('another').put({ id: 5, name: 'another item' });
// global update
// another update

docs/methods/unlisten.html.body:
.unlisten
Removes the given callback from the store context.
Usage
Store.unlisten(callback);

// returns context

Example
@store class ProductStore {}

const myCallback = () => doSomething();

ProductStore.listen(myCallback);
ProductStore.unlisten(myCallback);

docs/methods/get-key.html.body:
.getKey
Default unique key is id for Hacksaw stores but if you want to use
different keys to make the item unique you can use this method in your store.
Usage
@store class MyStore {
  static getKey(object) {
    return object.get('_id'); // assume you are using immutable js.
  }
}

Default
static getKey(object) {
  return object.id;
}

Tip
You can use a common class if your data structure is the same for all stores.
class MyCommonStore {
  static getKey(object) {
    return object._id;
  }
}

@store ProductStore extends MyCommonStore {}

docs/methods/merge.html.body:
.merge
You can use this method to override merge functionality.
Usage
@store class MyStore {
  static merge(currentItem, nextItem) {
    return currentItem.mergeDeep(nextItem); // assume you use immutable js
  }
}

Default
static getKey(currentItem, nextItem) {
  Object.assign(currentItem, nextItem);
  // if you return something hacksaw will put new references to the store
  // otherwise the old references will be the same
}
